import React from "react";
import { Link } from "react-router-dom";
import Navigation from "../Navigation/Navigation";


function HeaderPopup(props) {
    return (
        <div class="popup popup_opened">
            <div className="popup__container">
                <button className="popup__close"></button>
                <ul className="header__mobile-list">
                    <li><Link to='/' className="header__mobile">Главная</Link></li>
                    <li><Link to='/movies' className="header__mobile">Фильмы</Link></li>
                    <li><Link to='/saved-movies' className="header__mobile">Сохраненные фильмы</Link></li>
                </ul>
                <Link to="/profile" className="account__link account__link_mobile">
                <div className="account__logo" />
                Aккаунт
                </Link>


            </div>
        </div>
    );
}

export default HeaderPopup;
